code = ''
title_ico = base64.b64decode(code)


def timeConvert(size):
    if size >= 3600:
        h = str(int(size / 3600))
        m1 = size % 3600
        m = str(int(m1 / 60))
        seconds = str(m1 % 60)
    elif size >= 60:
        h = '00'
        m = str(int(size / 60))
        seconds = str(size % 60)
    else:
        h = '00'
        m = '00'
        seconds = str(size)

    h = h.zfill(2)
    m = m.zfill(2)
    seconds = seconds.zfill(2)

    if h == '00':
        return m + ':' + seconds
    else:
        return h + ':' + m + ':' + seconds


