    def setupUi(self):
        self.setWindowTitle("播放器")
        # self.setWindowOpacity(0.3)
        image = QImage.fromData(title_ico)
        pixmap = QPixmap.fromImage(image)
        self.setWindowIcon(QIcon(pixmap))
        self.resize(1200, 600)
        self.horizontalLayout = QHBoxLayout(self)
        self.listWidget = QListWidget(self)
        self.horizontalLayout.addWidget(self.listWidget)
        self.verticalLayout = QVBoxLayout()
        self.widget = QVideoWidget(self)
        self.verticalLayout.addWidget(self.widget)
        self.widget_2 = QWidget(self)
        self.horizontalLayout_2 = QHBoxLayout(self.widget_2)
        self.pushButton_2 = QPushButton('打开', self.widget_2)
        self.pushButton_2.setFixedWidth(40)
        self.pushButton_2.setFixedHeight(30)
        self.horizontalLayout_2.addWidget(self.pushButton_2)
        self.lcdNumber = QLCDNumber(self.widget_2)
        self.lcdNumber.setSegmentStyle(2)
        self.horizontalLayout_2.addWidget(self.lcdNumber)
        self.horizontalSlider_2 = QSlider(self.widget_2)
        self.horizontalSlider_2.setOrientation(Qt.Horizontal)
        self.horizontalLayout_2.addWidget(self.horizontalSlider_2)
        self.lcdNumber1 = QLCDNumber(self.widget_2)
        self.lcdNumber1.setSegmentStyle(2)
        self.horizontalLayout_2.addWidget(self.lcdNumber1)
        self.pushButton_3 = QPushButton('播放', self.widget_2)
        self.pushButton_3.setFixedWidth(40)
        self.pushButton_3.setFixedHeight(30)
        self.horizontalLayout_2.addWidget(self.pushButton_3)
        self.pushButton_4 = QPushButton('停止', self.widget_2)
        self.pushButton_4.setFixedWidth(40)
        self.pushButton_4.setFixedHeight(30)
